import  React from 'react';

import styles from './cart-table.module.css';

class CartTable  extends React.Component {
    render() {
        return (
            <div className={styles.container} >
               <div>
                   <span>Product Name</span>
               </div>
               <div>
                   <span>Price</span>
               </div>
               <div>
                   <span>Quantity</span>
               </div>
               <div>
                   <span>Total</span>
               </div>
               <div>
                   <span>Action</span>
               </div>
               
            </div>
        );
    }
}

export default CartTable;
